import React from 'react';

const ExperienceCard = (props) => {

  return (
      <div>
        <div className="mainContainer">
            <div className="subContainer">

            </div>
        </div>

    <style jsx>{`
        .mainContainer {
            background: red;
    }
        .subContainer {
            flex-direction: column;
        }
    `} </style>
      </div>
    
            
  );
};

export default ExperienceCard;
